INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (6, '2021-02-12 17:49:34.355584', '2021-02-12 17:49:34.355608', 'Alloying element', 'Chemical substances that are added to materials/metals to modify properties such as strength, hardness, or to facilitate treatment.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (13, '2021-02-12 17:52:15.314757', '2021-02-12 17:52:15.314786', 'Anti-scaling agent', 'Chemical substance added to products to prevent the build-up of inorganic oxide deposits. Prevents the build-up or removes lime scale and fouling. Also referred to as a descalers or descaling agent. Not corrosion inhibitor. The formation of scale can be caused by the deposition of salts or minerals and may not necessarily lead to surface corrosion.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (18, '2021-02-12 17:57:01.501264', '2021-02-12 17:57:01.501288', 'Binder', 'Chemical substances that are either synthetic/polymeric resins that further polymerize, provide structure and cohesiveness or are substances added to compounded dry powders to provide adhesive qualities during and after compression to make tablets or cakes. Also referred to as a binding agent or resin.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (27, '2021-02-12 18:00:33.236358', '2021-02-12 18:00:33.236383', 'Cloud-point depressant', 'Chemical substance that depresses the temperature at which solids begin to separate from a liquid at a temperature lower than that normally allowed', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (32, '2021-02-12 18:02:27.786979', '2021-02-12 18:02:27.787005', 'Deflocculant', 'Chemical substance used to fluidize concentrated slurries to reduce their bulk viscosity or stickiness in processing or handling. See closely related: anti-caking agent.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (35, '2021-02-12 18:03:35.475856', '2021-02-12 18:03:35.475882', 'Demulsifier', 'Chemical substance used to destroy an emulsion or prevent its formation.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (49, '2021-02-12 18:09:17.996740', '2021-02-12 18:09:17.996801', 'Explosion inhibitor', 'Chemical substance used to reduce the explosion potential of flammable materials.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (76, '2021-02-12 18:21:38.495522', '2021-02-12 18:21:38.495546', 'Lubricating agent', 'Chemical substance introduced between two moving surfaces or adjacent solid surface to reduce the friction between them, improve efficiency, reduce wear, and reduce heat generation. Enhances the lubricity of other substances to shear easily by minimizing contact between the rubbing surfaces so that the frictional force opposing the rubbing motion is low.', 23, 23);
INSERT INTO ep.v_functional_use_category (id, created_at, updated_at, title, description, created_by_id, updated_by_id) VALUES (83, '2021-02-12 18:23:42.614532', '2021-02-12 18:23:42.614558', 'Photosensitizers', 'Chemical substance that absorbs electromagnetic radiation and transfers energy to other materials making them susceptible to chemical change. e.g., activation of photographic emulsions; and photoresist.', 23, 23);
